#Birds Eye View
import pygame, time
import manual_calibration_testing
	
clock = pygame.time.Clock()

pygame.init()

#General Guesses on Field Dimensions in Inches:
#Width: 160 feet + 380 inches + 380 inches = 2680 inches?
#Length: 4320 inches?

#Guesstimations
field_width, field_length = 2664, 4140


half_field_length = int((field_length/2))

screen = pygame.display.set_mode((50, 50))
pygame.display.set_caption("Display")

red = (255, 0, 0)
blue = (0, 0, 255)
black = (0, 0, 0)
white = (255, 255, 255)

background = pygame.image.load("SoccerField.jpg").convert()
width, height = background.get_rect().size
scale_down = 0.5

IMAGE_SIZE = (int(scale_down*width), int(scale_down*height))
background = pygame.transform.scale(background, IMAGE_SIZE)
width, height = background.get_rect().size

half_width = int(width/2)
width_pix_worth = field_width/(height)
length_pix_worth = field_length/(width)

pixels_to_inches = manual_calibration_testing.get_pixels_to_inches_dictionary()

def convert_inches_to_field_coords(inches_x, inches_y) :
    field_width_ratio = ((field_width-inches_y)/field_width)
    field_length_ratio = ((half_field_length+inches_x)/field_length)
    return (int(width*field_length_ratio), int(height*field_width_ratio))

screen = pygame.display.set_mode((width, height))

